Chatnalin Chotijirawarachat (; born December 14, 1997) is a Thai beauty pageant titleholder, model and influencer. She was crowned Miss Intercontinental 2023 and previously won the title of 1st Runner-up at Miss Grand Thailand 2017 and Miss Universe Thailand 2023.
Early life
Chatnalin was born on December 14, 1997 in Kamphaeng Phet. She completed her secondary education at Kamphaeng Phet Pittayakhom School and received her bachelor's degree in Communication Arts from Bangkok University International College.
Career
Miss Grand Thailand 2017
She won Miss Grand Kamphaeng Phet 2017 and represented the province in Miss Grand Thailand 2017 and won the title of 1st Runner-up.
Miss Universe Thailand 2023
After being appointed as Miss Universe Thailand Prachuap Khiri Khan 2023, she continued to participate in Miss Universe Thailand 2023 and won the title of 1st runner-up.
Miss Intercontinental 2023
She then represented Thailand at Miss Intercontinental 2023 and was crowned.
